package model;

public class Diem {
	private int mamon;
	private String masv;
	private String diemchu;
	private double diem10;
	private double diem4;
	private double diemthi;
	private double diemcc;
	private double diembt;
	private double diemkt;
	private double diemth;
	private int kyhoc;
	
	
	
	public Diem() {
		super();
		// TODO Auto-generated constructor stub
	}


	public Diem(int mamon, String masv, String diemchu, double diem10, double diem4, double diemthi, double diemcc,
			double diembt, double diemkt, double diemth, int kyhoc) {
		super();
		this.mamon = mamon;
		this.masv = masv;
		this.diemchu = diemchu;
		this.diem10 = diem10;
		this.diem4 = diem4;
		this.diemthi = diemthi;
		this.diemcc = diemcc;
		this.diembt = diembt;
		this.diemkt = diemkt;
		this.diemth = diemth;
		this.kyhoc = kyhoc;
	}


	public int getMamon() {
		return mamon;
	}


	public void setMamon(int mamon) {
		this.mamon = mamon;
	}


	public String getMasv() {
		return masv;
	}


	public void setMasv(String masv) {
		this.masv = masv;
	}


	public String getDiemchu() {
		return diemchu;
	}


	public void setDiemchu(String diemchu) {
		this.diemchu = diemchu;
	}


	public double getDiem10() {
		return diem10;
	}


	public void setDiem10(double diem10) {
		this.diem10 = diem10;
	}


	public double getDiem4() {
		return diem4;
	}


	public void setDiem4(double diem4) {
		this.diem4 = diem4;
	}


	public double getDiemthi() {
		return diemthi;
	}


	public void setDiemthi(double diemthi) {
		this.diemthi = diemthi;
	}


	public double getDiemcc() {
		return diemcc;
	}


	public void setDiemcc(double diemcc) {
		this.diemcc = diemcc;
	}


	public double getDiembt() {
		return diembt;
	}


	public void setDiembt(double diembt) {
		this.diembt = diembt;
	}


	public double getDiemkt() {
		return diemkt;
	}


	public void setDiemkt(double diemkt) {
		this.diemkt = diemkt;
	}


	public double getDiemth() {
		return diemth;
	}


	public void setDiemth(double diemth) {
		this.diemth = diemth;
	}


	public int getKyhoc() {
		return kyhoc;
	}


	public void setKyhoc(int kyhoc) {
		this.kyhoc = kyhoc;
	}
	
	
}
